	(34, 0, 36, '{"job-description":"<div class=\\"job-item main-message job-description\\"> \\n <h3 class=\\"job-title\\">职位描述：</h3> \\n <div class=\\"content content-word\\">\\n  1、负责公司销售整体业绩、管理、运营， 根据公司整体战略，制定销售战略规划和策略并制定部门年度销售计划与销售目标，并分解到月和个人；\\n  <br>2、建立和管理销售队伍，招募、培训、激励、考核下属员工，提升部门工作效率；规范销售流程，完成销售目标；\\n  <br>3、监督并辅导团队成员工作，并根据公司整体业务目标进行不断的总结和优化。\\n  <br>4、 从事销售管理5年以上，其中3年以上同等职位销售管理经验，有集团化销售公司管理经验者优先；\\n  <br>5、具备较强的市场分析、团队管理、创新开拓能力；\\n  <br>6、对早教销售整体环境，营销管理有独到的见解。\\n  <br>微信分享 \\n </div> \\n</div>","title-info":"<div class=\\"title-info\\"> \\n <h1 title=\\"销售总监（几古几古）\\">销售总监（几古几古）</h1> \\n <h3> <a href=\\"https://www.liepin.com/company/9317750/\\" data-promid=\\"\\" target=\\"_blank\\" title=\\"武汉几古几古科技有限公司\\">武汉几古几古科技有限公司</a> </h3> \\n <span class=\\"triangle\\"></span> \\n</div>","summary":"<div class=\\"job-title-left\\"> \\n <p class=\\"job-item-title\\">18-24万 <em></em> <span class=\\"blue\\" title=\\"反馈时间以工作日为准，周末和假期时间不会计算在内\\">5天内反馈</span> </p> \\n <p class=\\"basic-infor\\"> <span> <i class=\\"icons24 icons24-position\\"></i> <a href=\\"https://www.liepin.com/wuhan/\\">武汉</a> </span> <time title=\\"2019年03月03日\\"><i class=\\"icons24 icons24-time\\"></i>10小时前 </time> </p> \\n <div class=\\"job-qualifications\\"> \\n  <span>学历不限</span> \\n  <span>经验不限</span> \\n  <span>普通话</span> \\n  <span>年龄不限</span> \\n </div> \\n</div>"}', '2019-03-03 15:40:03', '2019-03-03 15:40:03', 1),
