	(36, 0, 38, '{"job-description":"<div class=\\"job-item main-message job-description\\"> \\n <h3 class=\\"job-title\\">职位描述：</h3> \\n <div class=\\"content content-word\\">\\n  岗位职责：\\n  <br>1、组建销售团队，完成公司下达的季度/年度销售指标；\\n  <br>2、同各省的重点专家保持良好的沟通；\\n  <br>3、发起、组织和配合各省市的市场宣传和多种形式的销售活动；\\n  <br>4、负责各省经销商销售团队的培训和支持；\\n  <br>5、带领销售团队，及时、高效解决客户的抱怨和问题。\\n  <br>任职要求：\\n  <br>1、本科及以上医学（IT）专业，病理专业优先考虑；\\n  <br>2、良好的销售直觉，有5年及以上医疗器械产品（医疗信息化）销售经验，熟悉病理科（信息科）业务者优先考虑；\\n  <br>3、具有积极主动的工作态度，能够带领销售团队达成短期和长期销售数字；\\n  <br>4、有组建团队经验，善于团队管理与激励优先；\\n  <br>5、英文读/写/说表达能力，口语流利者优先考虑。\\n  <br>微信分享 \\n </div> \\n</div>","title-info":"<div class=\\"title-info\\"> \\n <h1 title=\\"销售总监（武汉）\\">销售总监（武汉）</h1> \\n <h3> <a href=\\"https://www.liepin.com/company/9400666/\\" data-promid=\\"\\" target=\\"_blank\\" title=\\"玖壹叁陆零医学科技南京有限公司\\">玖壹叁陆零医学科技南京有限公司</a> </h3> \\n <span class=\\"triangle\\"></span> \\n</div>","summary":"<div class=\\"job-title-left\\"> \\n <p class=\\"job-item-title\\">18-20万 <em></em> <span class=\\"blue\\" title=\\"反馈时间以工作日为准，周末和假期时间不会计算在内\\">5天内反馈</span> </p> \\n <p class=\\"basic-infor\\"> <span> <i class=\\"icons24 icons24-position\\"></i> <a href=\\"https://www.liepin.com/wuhan/\\">武汉-江汉区</a> </span> <time title=\\"2019年03月03日\\"><i class=\\"icons24 icons24-time\\"></i>10小时前 </time> </p> \\n <div class=\\"job-qualifications\\"> \\n  <span>大专及以上</span> \\n  <span>5年以上</span> \\n  <span>普通话</span> \\n  <span>年龄不限</span> \\n </div> \\n</div>"}', '2019-03-03 15:40:25', '2019-03-03 15:40:25', 1);
